      "section2_3": "2.3 支付：门票付款必须使用 \"2009\" 平台提供的支付方式进行。所有付款均安全处理。",
      "section2_4": "2.4 订单确认：成功购买后，您将通过电子邮件收到订单确认。这是您的购买证明。"
    },
    "section3": {
      "title": "3. 退款和取消",
      "section3_1": "3.1 退款政策：退款受主办方退款政策的约束。\"2009\" 将按照主办方的指示促成退款，但不直接负责发放退款。",
      "section3_2": "3.2 活动取消：若活动取消，主办方将负责提供退款或重新安排选项。"
    },
    "section4": {
      "title": "4. 用户行为",
      "section4_1": "4.1 禁止活动：用户同意不参与任何违反适用法律、侵犯他人权利或破坏 \"2009\" 平台运作的活动。",
      "section4_2": "4.2 账户安全：用户有责任维护其账户信息的机密性，并对其账户下发生的所有活动负责。"
    },
    "section5": {
      "title": "5. 责任限制",
      "section5_1": "5.1 无保证： \"2009\" 按“现状”和“可用”基础提供平台。\"2009\" 对平台的功能或可用性不作任何明示或暗示的保证。",
      "section5_2": "5.2 责任限制：在任何情况下，\"2009\" 对因使用平台或购买门票而引起的任何间接、附带、特殊、后果性或惩罚性损害不承担责任。"
    },
    "section6": {
      "title": "6. 知识产权",
      "section6_1": "6.1 所有权： \"2009\" 平台上的所有内容、商标和数据均为 \"2009\" 或其许可方的财产。未经事先书面同意，用户不得使用任何此类材料。"
    },
    "section7": {
      "title": "7. 隐私",
      "section7_1": "7.1 数据收集： \"2009\" 根据其隐私政策收集和处理个人数据。使用平台即表示您同意此类处理。",
      "section7_2": "7.2 数据共享： \"2009\" 可能会与主办方共享用户数据，以便促成购票和活动管理。"
    },
    "section8": {
      "title": "8. 条款变更",
