  "refund_policy": {
    "section1": {
      "title": "1. 适用范围",
      "section1": "本退款政策适用于通过 \"2009\" 活动票务平台购买的所有门票。所有退款请求必须遵守本政策条款。"
    },
    "section2": {
      "title": "2. 退款条件",
      "section2_1": "2.1 活动取消：如果活动被主办方取消，您有权获得全额退款。请注意，退款将根据主办方的指示进行处理，\"2009\" 不直接负责发放退款。",
      "section2_2": "2.2 活动延期或重新安排：如果活动被延期或重新安排，您可以选择保留门票以参加重新安排的活动，或在特定时间内申请退款。具体时间由主办方确定。",
      "section2_3": "2.3 个人原因：由于个人原因（如计划改变或无法出席）要求退款的请求，需遵循主办方的退款政策。主办方有权决定是否接受此类退款请求。"
    },
    "section3": {
      "title": "3. 退款程序",
      "section3_1": "3.1 退款请求：所有退款请求必须通过 \"2009\" 平台提交。请提供您的订单号、购买详情和退款原因。",
      "section3_2": "3.2 处理时间：处理退款请求的时间可能会有所不同，通常在收到请求后的 10-15 个工作日内完成。处理时间视具体情况而定。",
      "section3_3": "3.3 退款方式：退款将通过您原始购买时使用的支付方式进行。请注意，不同支付提供商的处理时间可能有所不同。"
    },
    "section4": {
      "title": "4. 不可退款费用",
      "section4_1": "4.1 服务费：购买门票时支付的任何服务费或手续费。",
      "section4_2": "4.2 配送费：如果门票是通过快递或其他配送方式发送的，配送费不予退还。"
    },
    "section5": {
      "title": "5. 特别情况",
      "section5_1": "5.1 特殊活动：对于某些特殊活动，可能会有不同的退款政策。请在购买前仔细阅读活动页面上的具体退款条款。",
      "section5_2": "5.2 多日活动：对于多日活动（如音乐节），如果某一天的活动被取消，退款政策将根据主办方的指示具体情况处理。"
    },
    "section6": {
      "title": "6. 联系信息",
      "section6_1": "6.1 如果您对退款政策有任何疑问或需要帮助，请通过以下方式联系 \"2009\" 客户服务团队：",
